import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Table.css';

function FondoPensionList() {
  const [fondos, setFondos] = useState([]);

  useEffect(() => {
    const fetchFondos = async () => {
      try {
        const response = await axios.get('/api/fondos-pension');
        setFondos(response.data);
      } catch (error) {
        console.error('Error fetching fondos de pensión:', error);
      }
    };

    fetchFondos();
  }, []);

  return (
    <div>
      <h2>Lista de Fondos de Pensión</h2>
      <table className="custom-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Nombre</th>
            {/* Añada más encabezados según los campos de su tabla */}
          </tr>
        </thead>
        <tbody>
          {fondos.map((fondo) => (
            <tr key={fondo.id}>
              <td>{fondo.id}</td>
              <td>{fondo.fields.Nombre}</td>
              {/* Añada más celdas según los campos de su tabla */}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default FondoPensionList;
